import React, { useEffect, useState } from "react";
import { getTaskList } from "../features/taskSlice";
import { useSelector, useDispatch } from "react-redux";

function Task(props) {
  const dispatch = useDispatch();
  const [tasks, setTasks] = useState([]);
  const { taskList } = useSelector((state) => state.task);
  const { token } = useSelector((state) => state.auth);
  let taskClef;
  let complete = [];
  let persentage;

  useEffect(() => {
    dispatch(getTaskList(token));
  }, []);

  console.log(taskList);
  console.log(props.x, props.taskClef);

  if (props.taskClef === "ùÑû") {
    taskClef = "G Clef";
  }
  if (props.taskClef === "ùÑ¢") {
    taskClef = "F Clef";
  }
  console.log(props.x, complete[0], taskList[0].cat);
  const res = taskList[0]?.subcat_name == taskClef;
  if (res === true) {
    if (complete != 0) {
      for (let i = 0; i < taskList.length; i++) {
        //clef
        // if (complete === undefined) {
        //   console.log("umdifie");
        //   complete.push({
        //     x: props.x,
        //     clef: taskClef,
        //   });
        //   continue;
        // }
        if (props.x === complete[i] && taskList[i].cat === 1) {
          console.log("here");
          complete[i].x = props.x;
          complete[i].clef = props.taskClef;
        } else {
          complete.push({
            x: props.x,
            clef: taskClef,
          });
        }
        //keysig
        if (props.x === complete[i] && taskList[i].cat === 3) {
          complete[i].x = props.x;
          complete[i].clef = props.taskKeySig;
        } else {
          complete.push({
            x: props.x,
            KeySig: props.taskKeySig,
          });
        }
      }
    }
  }

  persentage = (complete.length / taskList.length) * 100;
  console.log(complete);

  return (
    <div className="task-list">
      {taskList.map((task) => (
        <div key={task.id}>{task.name}</div>
      ))}
    </div>
  );
}

export default Task;
